pragma solidity 0.8.6;

import "@openzeppelin/contracts/token/ERC20/extensions/ERC20Burnable.sol";

contract AbraToken is ERC20Burnable {
    constructor(address initialPartners, address futurePartners,address reserveAddress) ERC20("Crypto Perx", "CPRX") {
        _mint(initialPartners, 1000000000);
        _mint(futurePartners, 1000000000);
        _mint(reserveAddress, 1000000000);
    }
}
